package in.Patterns;

public class SixthPattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char a='A';
		for (int i=1; i<=5; i++) {
			for (int j=1; j<=5; j++) {
				System.out.print(a++ +" ");
			}System.out.println();
		}
	}

}


